// Gallery.js

import React from 'react';

const Gallery = () => {
  return (
    <div class="container mx-auto py-10 pt-36">
      <div className="flex justify-center items-center">
      <h1 className="bg-gray-200 text-xl text-center rounded-lg font-Poppins font-bold mb-6 inline-block px-4 py-2">VISITS OUR CUSTOMER TOUR 
      GALLERY</h1>
      </div>
      <div class="grid grid-cols-3 gap-4">
        <div class="p-4">
          <img src="https://cdn.discordapp.com/attachments/1086315786446061711/1127161140976300043/A-5-1K.jpg" alt="Foto Pengunjung 1" class="rounded-lg w-full"></img>
        </div>
        <div class="p-4">
          <img src="path_to_image_2.jpg" alt="Foto Pengunjung 2" class="rounded-lg w-full"></img>
        </div>
        <div class="p-4">
          <img src="path_to_image_3.jpg" alt="Foto Pengunjung 3" class="rounded-lg w-full"></img>
        </div>
      </div>
    </div>
  );
};

export default Gallery;
